April 06, 2011

Kortney and Jackie are super excited. Johnny invited them to go on vacation with him and they are ready to go enjoy the beach. When Johnny shows up, however, he gives them some bad news. He was only able to get 2 tickets. Kortney wants that ticket, and she knows exactly how to convince Johnny to let her have it. Tits, ass, and some hot boning.
